/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div data-sap-ui-fastnavgroup="true" class="ui5-panel-root" role="${ifDefined(context.accRole)}" aria-label="${ifDefined(context.effectiveAccessibleName)}"><!-- header: either header or h1 with header text --><div @click="${context._headerClick}" @keydown="${context._headerKeyDown}" @keyup="${context._headerKeyUp}" class="ui5-panel-header" tabindex="${ifDefined(context.headerTabIndex)}" role="${ifDefined(context.accInfo.role)}" aria-expanded="${ifDefined(context.accInfo.ariaExpanded)}" aria-controls="${ifDefined(context.accInfo.ariaControls)}" aria-labelledby="${ifDefined(context.accInfo.ariaLabelledby)}">${ !context.fixed ? block1(context) : undefined }${ context._hasHeader ? block4(context) : block5(context) }</div><!-- content area --><div class="ui5-panel-content" id="${ifDefined(context._id)}-content" tabindex="-1" style="${styleMap(context.styles.content)}" part="content"><slot></slot></div></div>`; };
const block1 = (context) => { return html`<div class="ui5-panel-header-button-root">${ context._hasHeader ? block2(context) : block3(context) }</div>`; };
const block2 = (context) => { return html`<${scopeTag("ui5-button", tags, suffix)} design="Transparent" class="ui5-panel-header-button ${classMap(context.classes.headerBtn)}" icon="slim-arrow-right" @click="${context._toggleButtonClick}" ._buttonAccInfo="${ifDefined(context.accInfo.button)}" accessible-name="${ifDefined(context.accInfo.button.ariaLabelButton)}"></${scopeTag("ui5-button", tags, suffix)}>`; };
const block3 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} class="ui5-panel-header-button ui5-panel-header-icon ${classMap(context.classes.headerBtn)}" name="slim-arrow-right"></${scopeTag("ui5-icon", tags, suffix)}>`; };
const block4 = (context) => { return html`<slot name="header"></slot>`; };
const block5 = (context) => { return html`<div id="${ifDefined(context._id)}-header-title" role="heading" aria-level="${ifDefined(context.headerAriaLevel)}" class="ui5-panel-header-title">${ifDefined(context.headerText)}</div>`; };


	return block0(context);
};

export default main;
